-- Staging: movement counts for a MMSI/day
SELECT
  SUM(CASE WHEN COALESCE(sog,0) > 0.5 THEN 1 ELSE 0 END) AS sog_gt_0_5,
  SUM(CASE WHEN COALESCE(sog,0) <= 0.5 THEN 1 ELSE 0 END) AS sog_le_0_5,
  COUNT(*) AS total_rows
FROM noaa_ais_all_staging
WHERE mmsi = 367515090 AND year = 2024 AND month = 1 AND day = 2;

#	sog_gt_0_5	sog_le_0_5	total_rows
1	41	1182	1223


-- Staging: movement_flag distribution
SELECT movementflag, COUNT(*) AS rows
FROM noaa_ais_all_staging
WHERE mmsi = 367515090 AND year = 2024 AND month = 1 AND day = 2
GROUP BY movementflag;
#	movementflag	rows
1	0	1128
2	1	95


